import Content from "../component/Content";

function ContentList({ datas }) {
  return (
    <div>
      <header>
        <h2>목록</h2>
        <button>글쓰기</button>
      </header>
      {datas.map((data) => (
        <div>{data.content}</div>
      ))}
    </div>
  );
}

export default ContentList;
